script: |
  super -f text -I q2611.spq | sort > q2611.out

inputs:
  - name: q2611.spq
    data: |
      SELECT DISTINCT - + cor0.col0 AS col2 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab1

outputs:
  - name: q2611.out
    data: |
      -3
      -64
      -80
